import React, { Component } from 'react'
//Style
import './Home.css'
class Home extends Component {
  render() {
    return (
      <div className="Home">
        <h1>Welcome to React</h1>
        <p>
          In this recipe you will learn add style to Component.
          If you want learn more you can visit our chanel at < a href="http://youtube.com/codejobs">Code Jobs</a>
        </p>
        <p><button style={{ backgroundColor: 'gray', border: '1px solid black' }}>Click me!</button></p>
      </div>
    )
  }
}


export default Home;
